caption.text:
Desain apron dengan lambang burung garuda pada bagian dada dengan makna selalu dibawanya semangat kemerdekaan yang membara seperti api. Semboyan 'Bhineka Tunggal Ika' yang mempersatukan bangsa diperkuat oleh keberadaan motif batik sekar jagad yang memiliki esensi keindahan dan keberagaman Indonesia. Motif sekar jagad juga melambangkan 'dunia', menggambarkan luasnya negara kepulauan Indonesia.

