Desain apron dengan konsep warna gelap agar tidak mudah terekspos noda. Aksen berupa wayang golek sebagai salah satu bentuk kekayaan budaya dan seni milik Indonesia. Terdapat pula gugusan pulau yang menunjukan eksistensi Indonesia sebagai negara kepulauan terbesar di dunia.

